import { all, fork, put, takeLatest, delay } from "redux-saga/effects";
import axios from "axois";

export default function* rootSaga() {
  yield all([fork(watchLogIn), fork(watchLogOut), fork(watchAddPost)]); // all로 이벤트 리스너 등록
}
